      value:
        0: |-
          Das Gebilde vor euch am Baum ist etwa einen Schritt hoch und hnelt stark einem kleinen Baum, gar einer Eiche. Die Wurzeln wurden so angefertigt, dass jene den Stamm halten knnen. Der Stamm erscheint robust und beeinhaltet viele Einkerbungen, die an eine Rinde erinnern, die Farbe kommt einem dunklen Braunton gleich.
          Als der Stamm endet und sich einem geschnitzen Geflecht verluft scheint der Braunton zu den Spitzen hin heller zuwerden, das Holz wirkt weicher und harmonischer als der Stamm.
          Viele Verzweigungen wurde geschnitzt und auch Bltter aus Holz die matt glnzen wurden mit grer Sorgfalt an ihren Platz eingearbeit, man knnte behaupten wenn man blinzelt das sich jene leicht in einem Windhauch wiegen.
          Zwei etwas dickere ste fhren den Stamm nach oben hin weiter und verlaufen in sich selbst. Sie umschlingen sich, da wo sich die Baumkrone befinden sollte und umrahmen einen glnzenden Alexandrit, welcher das Licht, das auf ihn fllt wie ein Prisma bricht und somit die verschiedenen sichtbaren Farben reflektiert und den Altar erstrahlen lsst.
